(function(){"use strict";function handleClick(e){var anchor=e.currentTarget;var url=anchor.getAttribute("href");var element;if(/^(javascript|mailto|data|blob):/.test(url)){return true}var pathNav=!/\:?\/\//.test(url);var fragmentId=/^\s*#/.test(url);if(fragmentId){element=document.querySelector(url)||document.getElementsByName(url.slice(1));if(element){element=element[0]||element;element.scrollIntoView(true)}}else if(pathNav&&window._Brackets_LiveDev_Transport){window._Brackets_LiveDev_Transport.send("bramble-navigate:"+url)}else{window.open(url,"_blank")}return false}addEventListener("DOMContentLoaded",function init(){var links=document.links;var len=links.length;for(var i=0;i<len;i++){links[i].onclick=handleClick}},false)})();